import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
  background: var(--color-background);
  padding: 2rem 0;
  border-top: 1px solid var(--color-border);
`;

const FooterContent = styled.div`
  max-width: 980px;
  margin: 0 auto;
  padding: 0 22px;
`;

const FooterGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(5, 1fr);
  gap: 2rem;
  margin-bottom: 2rem;

  @media (max-width: 768px) {
    grid-template-columns: repeat(2, 1fr);
  }
`;

const FooterColumn = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.5rem;
`;

const ColumnTitle = styled.h3`
  font-size: 12px;
  font-weight: 600;
  color: var(--color-text-secondary);
  margin-bottom: 0.5rem;
`;

const FooterLink = styled.a`
  font-size: 12px;
  color: var(--color-text-secondary);
  text-decoration: none;
  transition: color 0.3s ease;

  &:hover {
    color: var(--color-text-primary);
    text-decoration: underline;
  }
`;

const FooterBottom = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding-top: 1rem;
  border-top: 1px solid var(--color-border);
  font-size: 12px;
  color: var(--color-text-secondary);

  @media (max-width: 768px) {
    flex-direction: column;
    gap: 1rem;
    text-align: center;
  }
`;

const Footer: React.FC = () => {
  return (
    <FooterContainer>
      <FooterContent>
        <FooterGrid>
          <FooterColumn>
            <ColumnTitle>Shop and Learn</ColumnTitle>
            <FooterLink href="#">Store</FooterLink>
            <FooterLink href="#">Mac</FooterLink>
            <FooterLink href="#">iPad</FooterLink>
            <FooterLink href="#">iPhone</FooterLink>
            <FooterLink href="#">Watch</FooterLink>
          </FooterColumn>
          <FooterColumn>
            <ColumnTitle>Services</ColumnTitle>
            <FooterLink href="#">Apple Music</FooterLink>
            <FooterLink href="#">Apple TV+</FooterLink>
            <FooterLink href="#">Apple Fitness+</FooterLink>
            <FooterLink href="#">iCloud</FooterLink>
            <FooterLink href="#">Apple One</FooterLink>
          </FooterColumn>
          <FooterColumn>
            <ColumnTitle>Apple Store</ColumnTitle>
            <FooterLink href="#">Find a Store</FooterLink>
            <FooterLink href="#">Genius Bar</FooterLink>
            <FooterLink href="#">Today at Apple</FooterLink>
            <FooterLink href="#">Apple Camp</FooterLink>
            <FooterLink href="#">Apple Store App</FooterLink>
          </FooterColumn>
          <FooterColumn>
            <ColumnTitle>For Business</ColumnTitle>
            <FooterLink href="#">Apple and Business</FooterLink>
            <FooterLink href="#">Shop for Business</FooterLink>
            <ColumnTitle>For Education</ColumnTitle>
            <FooterLink href="#">Apple and Education</FooterLink>
            <FooterLink href="#">Shop for K-12</FooterLink>
          </FooterColumn>
          <FooterColumn>
            <ColumnTitle>Apple Values</ColumnTitle>
            <FooterLink href="#">Accessibility</FooterLink>
            <FooterLink href="#">Environment</FooterLink>
            <FooterLink href="#">Privacy</FooterLink>
            <FooterLink href="#">Supplier Responsibility</FooterLink>
          </FooterColumn>
        </FooterGrid>
        <FooterBottom>
          <div>Copyright Â© 2024 Your Company. All rights reserved.</div>
          <div>
            <FooterLink href="#">Privacy Policy</FooterLink> |{' '}
            <FooterLink href="#">Terms of Use</FooterLink> |{' '}
            <FooterLink href="#">Sales and Refunds</FooterLink> |{' '}
            <FooterLink href="#">Legal</FooterLink> |{' '}
            <FooterLink href="#">Site Map</FooterLink>
          </div>
        </FooterBottom>
      </FooterContent>
    </FooterContainer>
  );
};

export default Footer;
